import React from 'react';
import s from './Skills.module.css';
import Tikoit from '../../assets/images/Tikoit.jpg';

const Skills = () => {
    return (
        <div id='skills' className={s.body}>
            <img  className={s.Tigran_img} src={Tikoit} alt="my_image" />

            <div className={s.skills_right_div}>

                {/* my image */}

                {/*header*/}
                <br />
                <br />
                <span id={s.header}>Ինչ եմ անում ես</span>

                {/* text about me*/}
                <span id={s.about_me}>CRAZY FULL STACK DEVELOPER WHO WANTS TO EXPLORE EVERY TECH STACK</span>

                <div className={s.languages}>
                    <img src="https://webref.ru/assets/images/book/html5.png" alt="HTML" />
                    <div className={s.languages_without_html}>
                    <img id={s.css} src="https://www.toolbox.am/img/trainings/icons//css3-logo.png" alt="CSS" />
                    <img id={s.js} src="https://html5hive.org/wp-content/uploads/2014/06/js_800x800.jpg" alt="JavaScript" />
                    <img id={s.jquery} src="https://avatars.githubusercontent.com/u/70142?s=200&v=4" alt="jQuery" />
                    <img id={s.react} src="https://uxwing.com/wp-content/themes/uxwing/download/07-design-and-development/react-js.png" alt="React" />
                    <img id={s.redux} src="https://cdn.iconscout.com/icon/free/png-512/redux-283024.png" alt="Redux" />
                    <img id={s.wordpress} src="https://image.flaticon.com/icons/png/512/174/174881.png" alt="Wordpress" />
                    </div>
                    <br />
                    <span className={s.languages_names}>HTML CSS JavaScript jQuery React Redux Wordpress</span>
                </div>

                {/*my skills */}
                <div className={s.mySkills}>
                    <span>⚡Lorem ipsum dolor, sit amet consectetur adipisicing elit. Ipsa iure magnam dolores vel alias odit.</span>
                    <br /><br />
                    <span>⚡Lorem ipsum dolor sit amet consectetur adipisicing elit. Quod?</span>
                    <br /><br />
                    <span>⚡Lorem ipsum dolor sit amet consectetur adipisicing elit. Tempora sequi aut aspernatur.</span>
                </div>
            </div>
        </div>
    );
}

export default Skills;
